import React from 'react';
import './Navigation.css';

const Navigation = ({ onSignOutRequest }) => {
    return (
        <nav className={'Navbar'}>
            <p className='f3 link dim black underline pa3 pointer' onClick={onSignOutRequest}>Sign Out</p>
        </nav>
    );
};

export default Navigation;
